montageDefine("845cab0","vendor/requirejs/tests/doh/runner.html",{text:'<html><head>\n		<title>RequireJS Tests Via The Dojo Unit Test Harness, $Rev: 20149 $</title>\n\n		<script>/3[\\.0-9]+ Safari/.test(navigator.appVersion)&&(window.console={origConsole:window.console,log:function(e){this.origConsole.log(e)},info:function(e){this.origConsole.info(e)},error:function(e){this.origConsole.error(e)},warn:function(e){this.origConsole.warn(e)}});</script>\n\n		<script>window.dojoUrl="../../dojo/dojo.js",window.testUrl="",window.testModule="";var qstr=window.location.search.substr(1);if(qstr.length)for(var qparts=qstr.split("&"),x=0;qparts.length>x;x++){var tp=qparts[x].split("=");if("dojoUrl"==tp[0]&&(window.dojoUrl=tp[1]),"testUrl"==tp[0]&&(window.testUrl=tp[1]),"testModule"==tp[0]&&(window.testModule=tp[1]),"registerModulePath"==tp[0]){var modules=tp[1].split(";");window.registerModulePath=[];for(var i=0;modules.length>i;i++)window.registerModulePath.push(modules[i].split(","))}}</script>\n		<script src=runner.js></script>\n		<script src=_browserRunner.js></script>\n\n		<script>testUrl.length&&document.write("<script type=\'text/javascript\' src=\'"+testUrl+".js\'></scr"+"ipt>");</script>\n		<style type=text/css>#testLayout{position:relative;border:1px solid #000}#testLayout,.tabBody{border:0;width:100%;height:100%;left:0;top:0}.tabBody{margin:0;padding:0;background-color:#DEDEDE;position:absolute;overflow:auto}#logBody{padding-left:5px;padding-top:5px;font-family:Monaco,monospace;font-size:11px;white-space:pre}#progressOuter{background:#e9e9e9 url("http://o.aolcdn.com/dojo/1.3/dijit/themes/tundra/images/dojoTundraGradientBg.png") repeat-x 0 0;height:1em;_margin:1px;_padding:-1px}#progressOuter .success,#progressOuter .failure{float:left;height:1em}#play,#pause{font-family:Arial;font-size:1.4em;cursor:pointer;padding-right:.5em}#play,#pause,.header{border:1px solid #DEDEDE}button.tab{border-width:1px 1px 0 1px;border-style:solid;border-color:#DEDEDE;margin-right:5px}#testListContainer{position:relative;height:99%;width:100%;overflow:auto}#testList{border-collapse:collapse;position:absolute;left:0;width:100%}#testList td,#testListHeader th{border-bottom:1px solid #DEDEDE;border-right:1px solid #DEDEDE;padding:3px}#testListHeader th{font-weight:bolder;font-style:italic}#testList tfoot{font-weight:700}#toggleButtons{float:left;background-color:#DEDEDE}div.testGroupName{position:absolute}.inProgress{background-color:#85afde}.success{background-color:#7cdea7}.failure{background-color:#de827b}</style>\n	</head>\n	<body>\n		<table id=testLayout cellpadding=0 cellspacing=0 style="margin: 0">\n			<tbody><tr valign=top height=40>\n				<td colspan=2 id=logoBar>\n					<h3 style="margin: 5px 5px 0px 5px; float: left">RequireJS Tests Via D.O.H.: The Dojo Objective Harness</h3>\n					<img src=small_logo.png height=40 style="margin: 0px 5px 0px 5px; float: right">\n					<span style="margin: 10px 5px 0px 5px; float: right">\n						<input type=checkbox id=audio name=audio>\n						<label for=audio>sounds?</label>\n					</span>\n				</td>\n			</tr>\n			<tr valign=top height=10>\n				<td colspan=2><div id=progressOuter onclick=doh._jumpToSuite(arguments[0])></div></td>\n			</tr>\n			<tr valign=top height=30>\n				<td width=30% class=header>\n					<span id=toggleButtons onclick=doh.togglePaused()>\n						<button id=play>►</button>\n						<button id=pause style="display: none">║</button>\n					</span>\n					<span id=runningStatus>\n						<span id=pausedMsg>Stopped</span>\n						<span id=playingMsg style="display: none">Tests Running</span>\n					</span>\n				</td>\n				<td width=* class=header valign=bottom>\n					<button class=tab onclick=doh.showTestPage()>Test Page</button>\n					<button class=tab onclick=doh.showLogPage()>Log</button>\n                    <button class=tab onclick=doh.showPerfTestsPage()>Performance Tests Results</button>\n				</td>\n			</tr>\n			<tr valign=top style="border: 0; padding: 0; margin: 0">\n				<td height=100% style="border: 0; padding: 0; margin: 0">\n					<div id=testListContainer>\n						<table cellpadding=0 cellspacing=0 border=0 width=100% id=testList style="margin: 0" onclick=doh._jumpToLog(arguments[0])>\n							<thead>\n								<tr id=testListHeader style="border: 0; padding: 0; margin: 0">\n									<th>&nbsp;</th>\n									<th width=20>\n										<input type=checkbox checked=checked onclick=doh.toggleRunAll()>\n									</th>\n									<th width=* style="text-align: left">test</th>\n									<th width=50>time</th>\n								</tr>\n							</thead>\n							<tbody valign=top>\n								<tr id=groupTemplate style="display: none">\n									<td style="font-family: Arial; width: 15px">►</td>\n									<td>\n										<input type=checkbox checked=checked>\n									</td>\n									<td>group name</td>\n									<td>10ms</td>\n								</tr>\n								<tr id=testTemplate style="display: none">\n									<td>&nbsp;</td>\n									<td>&nbsp;</td>\n									<td style="padding-left: 20px">test name</td>\n									<td>10ms</td>\n								</tr>\n							</tbody>\n						</table>\n					</div>\n				</td>\n				<td>\n					<div style="position: relative; width: 99%; height: 100%; top: 0px; left: 0px">\n						<div class=tabBody style="z-index: 1">\n							<pre id=logBody></pre>\n							<div id=perfTestsBody style="background-color: white"></div>\n						</div>\n						<iframe id=testBody class=tabBody style="z-index: -1"></iframe>\n						\n					</div>\n				</td>\n			</tr>\n		</tbody></table>\n		<span id=hiddenAudio></span>\n	\n\n\n</body></html>'});